export const REVIEW_ACTIONS = {
  loadReviews: "review/loadReviews",
  startLoading: "review/startLoading",
  successLoading: "review/successLoading",
  failLoading: "review/failLoading",
};

export const loadReviews = (restaurantId) => ({
  type: REVIEW_ACTIONS.loadReviews,
  payload: restaurantId,
});

export const successLoading = (normalizedReview) => ({
  type: REVIEW_ACTIONS.successLoading,
  payload: normalizedReview,
});

export const failLoading = () => ({
  type: REVIEW_ACTIONS.failLoading,
});

export const startLoading = () => ({
  type: REVIEW_ACTIONS.startLoading,
});
